import React, { useState, useEffect } from 'react';
import axios from 'axios';

const Home = () => {
  const [user, setUser] = useState([]);

  useEffect(() => {
    const fetchUser = async () => {
      const { data } = await axios.get('/server/routes/index');
      setUser(data);
    };

    fetchUser();
  }, []);

  const { firstName } = user;

  const [noticias, setNoticias] = useState([]);

  useEffect(() => {
    const fetchData = async () => {
      const response = await axios.get('http://servicodados.ibge.gov.br/api/v3/noticias/empreendedorismo+negocios');
      setNoticias(response.data.noticias);
    };

    fetchData();
  }, []);

  return (
    <><div>
      <h1>Bem vindo, {firstName}</h1>
    </div><div>
        <h1>Notícias sobre Empreendedorismo e Negócios</h1>
        <ul>
          {noticias.map((noticia) => (
            <li key={noticia.id}>
              <h2>{noticia.titulo}</h2>
              <p>{noticia.resumo}</p>
              <a href={noticia.link}>Leia mais</a>
            </li>
          ))}
        </ul>
      </div></>
  );
};

export default Home;
